import React, { Component } from 'react'
import axios from 'axios'

const boxStyles = {
    padding: '0.5em',
    margin: ' 0.5em',
    border: '1px solid gray',
    borderRadius: '0.3em',
    textAlign: 'center'
}

class Cards extends Component {
    render() {
        const { list, render } = this.props

        return (
            <div>
                {list.map((item, index) => {

                    if (render) {
                        return render(item, index)
                    }

                    if (item.category >1) { 
                        return (
                            <li key={item.tittle}>
                                { item.tittle}
                            </li>
                        )
                    }
                })}
            </div>
        )
    }
}

export default class Servicios extends Component {
    state = {
        prop: []
    }

    componentDidMount() {
        axios.get('http://localhost:3001/propiedades')
            .then(res => {
                const prop = res.data;
                this.setState({ prop });
            })
    }


    render() {
        const { prop } = this.state
        return (
            <div style={boxStyles}>
                <Cards
                    list={prop}
                />
            </div>
        )
    }
}
